,(3782,'fr','Site de la CMR'),(3783,'ar',''),(3783,'fr',''),(3784,'ar',''),(3784,'fr',''),(3785,'ar','في ظل حالة الطوارئ الصحية التي تعرفها بلادنا، ومن أجل ضمان الاستمرار في تقديم خدمات ذات جودة عالية لمرتفقيه وزواره يوفر لكم الصندوق المغربي للتقاعد خدمتي استقبال بالموعد وذلك عبر آليتين إثنتين:\r\n\r\n<br /><br /><b> - \r\n\r\nالاستقبال عن طريق الحضور الشخصي: </b> تتيح هذه الخدمة إمكانية أخذ موعد مسبق في أحد فضاءات الاستقبال التابعة للصندوق المغربي للتقاعد، سواء بالمقر الرئيسي بالرباط أو المندوبيات الجهوية، مع الموظف المكلف بالاستقبال والتوجيه وذلك حسب التاريخ والتوقيت الذي يناسبكم.\r\n\r\n<br /><br /> - \r\n<b>\r\nالاستقبال عن بعد: </b> تمكنكم هذه الخدمة المبتكرة،من التواصل عن بعد، عن طريق تقنية الفيديو، من بيتكم، مع الموظف المكلف بالاستقبال والتوجيه للاستفسار عن كل ما يخص ملفاتكم.\r\n<br /><br />'),(3785,'fr','Dans le contexte particulier de l’état d’urgence sanitaire, et afin de pouvoir continuer à vous assurer un service de qualité, la <span style=\"white-space: nowrap;\"><b>Caisse Marocaine des Retraites</b></span> vous offre deux services d’accueil sur Rendez –Vous :\r\n\r\n<br /><br /><b> - Accueil en présentiel :</b> ce dispositif vous permet de prendre rendez-vous dans l’un des espaces d’accueil de la CMR (siège et délégations régionales) avec un chargé d’information et de conseil selon votre disponibilité à la date et heure de votre convenance.\r\n\r\n<br /><br /><b> - Accueil par visio conférence :</b> ce service innovant vous permet de vous entretenir à distance, sur Rendez-Vous, en visuel et à partir de chez vous, avec un chargé d’information de conseil au sujet des dossiers vous concernant.\r\n<br /><br />'),(3786,'ar','مرحبًا بكم في بوابة الاستقبال بموعد لدى الصندوق المغربي للتقاعد'),(3786,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès de la Caisse Marocaine des Retraites.'),(3787,'ar','Administrateur Organisation CMR'),(3787,'fr','Administrateur Organisation CMR'),(3788,'ar','Administrateur Etablissement CMR'),(3788,'fr','Administr