ية وإصلاح الإدارة - قطاع إصلاح الإدارة'),(4806,'fr','Ministère de l’Economie, des Finances et de la Réforme de l’administration - Département de la Réforme de l\'Administration-'),(4807,'ar','MSG'),(4807,'fr','MSG'),(4808,'ar',''),(4808,'fr','www.mmsp.gov.ma'),(4809,'ar',''),(4809,'fr',''),(4810,'ar',''),(4810,'fr',''),(4811,'ar','في إطار تحسين تدبير تدفقات المرتفقين والرفع من جودة الخدمات المقدمة ، وضع قطاع إصلاح الإدارة منصة إلكترونية لأخذ المواعيد عبر الإنترنت أو الهاتف.\r\n<br /><br />\r\nويمكن الاستفادة من خدمة الاستقبال بالموعد عبر آليتين:\r\n<br /><br />\r\n- الإستقبال عن طريق الحضور : تتيح هذه الخدمة إمكانية أخذ موعد مسبق مع المصلحة المسؤولة عن معالجة طلب المرتفق وذلك من خلال تحديد التاريخ والتوقيت المناسبين\r\n<br /><br />\r\n- الإستقبال عن بعد : تتيح هذه الخدمة التواصل عن بعد، عن طريق تقنية الفيديو، بعد تحديد موعد مسبق مع المصلحة المكلفة بمعالجة طلب المرتفق\r\n\r\n '),(4811,'fr','Dans le cadre de l’optimisation des flux des usagers et afin d’assurer une meilleure gestion de vos demandes,  le Département de la Réforme de l’Administration a mis en place une plateforme informatisée dédiée à la prise de rendez-vous par internet ou par téléphone. \r\n<br /><br />\r\nL’accueil sur rendez-vous peut se faire, à votre convenance, par les deux voies :\r\n<br /><br />\r\n-             en présentiel : en prenant rendez-vous dans le siège du département avec l’entité chargée du traitement de votre requête ;\r\n<br /><br />\r\n-             à distance: ce service vous permet de vous entretenir sur Rendez-Vous, par Visio conférence avec un représentant de l’entité chargée du traitement de votre requête.'),(4812,'ar','مرحبا بكم في بوابة أخذ المواعيد لدى قطاع إصلاح الإدارة'),(4812,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès du Département de la Réforme de l’Administration '),(4813,'ar','Administrateur Organisme'),(4813,'fr','Administrateur Organisme'),(4814,'ar','Boukhani'),(4814,'fr',' Boukhani'),(4815,'ar','Mohamed'),(4815,'fr','Mohamed'),(4816,'ar'