cette plate-forme qui permet : \r\n<br /><br /><b>- La prise des Rendez-Vous en ligne</b> avant de vous déplacer aux locaux de la DGAC pour toute nature de prestation : Demande de reseignements, Dépôt de dossiers, Retrait de titres ou autres. Cela vous garantira la disponibilité d’un représentant de l’administration pour prendre en charge votre requête et selon des horaires que vous choisirez vous-même. \r\n<br /><br /><b>- Le Télé-accueil</b> qui vous permet d’effectuer, sur Rendez-Vous, des entretiens ou des séances de travail en visioconférence avec la personne concernée de la DGAC sans avoir à vous déplacer.\r\n<br /><br /><b>Aidez nous à vous recevoir correctement. Ne vous déplacez que si cela est nécessaire. Pensez à prendre votre Rendez-Vous à l’avance.</b>\r\n'),(5027,'ar','مرحبا بكم في بوابة أخذ المواعيد لدى المديرية العامة للطيران المدني'),(5027,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès de la Direction Générale de l\'Aviation Civile'),(5028,'ar','Administrateur Organisme'),(5028,'fr','Administrateur Organisme'),(5029,'ar','Admin Aviation Civile'),(5029,'fr','Admin Aviation Civile'),(5030,'ar','Admin Aviation Civile'),(5030,'fr','Admin Aviation Civile'),(5031,'ar','شارع الزيتون، حي الرياض، الرباط     '),(5031,'fr','Avenue Azzaitoune, Hay Riyad, Rabat'),(5032,'ar','المديرية العامة للطيران المدني'),(5032,'fr','Direction Générale de l\'Aviation Civile'),(5033,'ar',''),(5033,'fr',''),(5034,'ar','استعلامات'),(5034,'fr','Demande de Reinseignements'),(5035,'ar','إيداع، استكمال و معالجة الملفات '),(5035,'fr','Dépôt/ Traitement/ Complément de dossier'),(5036,'ar','سحب السندات'),(5036,'fr','Retrait de Titre/ Autorisation'),(5037,'ar','الصفقات وسندات الطلب'),(5037,'fr','Marchés, Bons de commandes'),(5038,'ar','الخطوط الجوية والمفاوضات'),(5038,'fr','Négociations et Lignes Aériennes'),(5039,'ar','رخص ممارسة حقوق النقل الجوي'),(5039,'fr','Autorisations de droit de trafic'),(5040,'ar','رخص الاستغلال: الملف المالي'),(5040,'fr','Autorisation d\'explo